import random
import sys

# Import umbrella.txt as text
path = 'umbrella.txt'  # Replace with the actual path to your text file
text = ''' '''
try:
    with open(path, 'r') as file:
        text = file.read()
except FileNotFoundError:
    print(f"Error: The file '{path}' was not found.")
except Exception as e:
    print(f"An error occurred: {e}")

# Constants
YES = '@' 
NO = " "

# Simulate a coin flip by selecting 0 or 1 at random (based on a set of
# given weights) where 0 is heads and 1 is tails
def flip(weights: [int] = [1, 1]) -> int:
    return random.choices(population = [0, 1], weights = weights, k = 1)[0]

# Flip a coin and return the appropriate outcome (which could be another coin flip)
def flips(heads: str, tails: str) -> str:
    return heads if flip() == 0 else tails

# Return the true response if the first flip is heads, otherwise
# flip again and return YES if it's heads or NO if it's tails
def rand_res(res: str) -> str:
    return flips(res, flips(YES, NO)) 

# Run the code and print the output for each task
def main() -> None:
    args = sys.argv[1:]
    if (len(args) == 1):
        choice = args[0]
        match int(choice):
            case 0:
                # Apply the randomized response function to every participant
                # in the ASCII picture and print the result
                print(f'With randomization...\n')
                apply : callable[str, str] = lambda x : rand_res(x) if x in (YES, NO) else x
                print(''.join(map(apply, text)))
            case 1:
                print(f'Without randomization...\n')
                print(text)
            case _:
                print('Operation does not exist\n')
    else:
        print('Usage: python3 main.py <0,1>\n')

if __name__ == '__main__':
    main()

